import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Components
import PageTitle from '../components/PageTitle';
import Location from '../components/Location';
// Material Components
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
// Utils
import { prayerbeads } from '../utils/prayerbeads';

const styles = theme => ({
  root: {
    flexGrow: 1,
    minHeight: '100%',
    display: 'flex',
    alignItems: 'center',
    padding: '100px 0',
    background: 'url(/assets/images/sekiro-shadows-die-twice.jpg) center top fixed',
    backgroundSize: 'cover',
  }
});

function PrayerBeads(props) {
  const { classes } = props;
  const pagetitle = 'Prayer Beads';

  return (
    <div className={classes.root}>
      <PageTitle pagetitle={pagetitle} />
      <Grid container spacing={24} justify="center">
        <Grid item xs={6}>
          <Location prayerbeads={prayerbeads} />
        </Grid>
      </Grid>
    </div>
  );

}

PrayerBeads.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(PrayerBeads);
